const sockets = require("../../Component/moudle/sockets.js");

export const Find_ID = (formData, setFormData, navigate) => {
  try {
    sockets.FindID_Server(formData);
  } catch (error) {
    console.log("Sign-up error:", error);
    alert("서버 오류. 다시 시도해 주세요.");
  } finally {
    sockets.Disconnect();
  }
